import React from "react";
import styled from "styled-components";

const ListUser = ({ ProfilePicture, Name, Link, Company, Address, Stars }) => (
  <Container>
    <ul>
      <li>
        <div className="BoxInforStart">
          <div className="BoxImgPerfil">
            <img src={ProfilePicture} />
          </div>
          <div className="BoxNome">
            <h3>
              {Name}
              <svg
                xmlns="http://www.w3.org/2000/svg"
                width="11"
                height="16"
                viewBox="0 0 11 16"
                fill="none"
              >
                <path
                  d="M0.4375 14.125L6.5625 8L0.4375 1.875L2.3125 0L10.3125 8L2.3125 16L0.4375 14.125Z"
                  fill="black"
                />
              </svg>
            </h3>
            <p>@johndoesantos</p>
          </div>
        </div>
        {ProfilePicture} {Name} {Link} {Company} {Address} {Stars}
      </li>
    </ul>
  </Container>
);

const Container = styled.div`
  background-color: #fff;
  display: flex;
  background: red;
  ul {
    margin: 0px;
    padding: 0px;
    width: 100%;
    li {
      background-color: #fff;
      padding: 20px;
      width: auto;
      border: solid 1px;
      margin: 10px 10% 10px 10%;
      display: flex;
      flex-direction: column;
      div.BoxInforStart {
        background: red;
        display: flex;
        flex-direction: row;
        .BoxImgPerfil {
          width: 70px;
          height: 70px;
          background: blue;
        }
      }
    }
  }
`;

export default ListUser;
